INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'CA ', N'SDRAM - 128 MB', N'Memria SDRAM, 128 MB de capacitat. Amb SDRAM es pot accedir a les dades a una velocitat de fins a 100 MHz, una rapidesa quatre vegades superior que amb les DRAM estndard. No obstant aix, els avantatges de l''SDRAM noms es poden aprofitar plenament en ordinadors dissenyats per suportar aquesta memria. L''SDRAM est disponible en DIMM de 5 i 3,3 volts.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'CS ', N'SDRAM - 128 MB', N'Pam?? SDRAM, kapacita 128 MB. SDRAM m?e mt kmito?et p?stupu k dat?m a 100 MHz, co je a ?ty?ikrt rychlej ne u standardn DRAM. Vhody pam?t SDRAM mohou bt pln? vyuity, ale jen u po?ta??, navrench na podporu pam?t SDRAM. Pam?ti SDRAM se dodvaj na modulech DIMM pro nap?t 5 V a 3,3 V.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'D  ', N'SDRAM - 128 MB', N'SDRAM-Speicher, 128 MB Kapazitt. SDRAM kann mit Geschwindigkeiten von bis zu 100 MHz auf Daten zugreifen, d.h. vier Mal schneller als standardmige DRAMs. Die Vorteile von SDRAM knnen jedoch nur bei Rechnern voll ausgeschpft werden, die SDRAM untersttzen.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'DK ', N'SDRAM - 128 MB', N'SDRAM-hukommelse, 128 MB kapacitet. SDRAM kan tilgribe data med hastigheder p op til 100 MHz, hvilket er op til fire gange s hurtigt som standard-DRAM-moduler. Fordelene ved SDRAM kan imidlertid kun opleves fuldt ud p computere, der er designet til at understtte SDRAM. SDRAM fs p 5 og 3,3 volt DIMM-moduler.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'E  ', N'SDRAM - 128 MB', N'Memoria SDRAM, 128 MB de capacidad. SDRAM puede acceder a los datos a una velocidad de hasta 100 MHz, que es cuatro veces la velocidad estndar de DRAM. Sin embargo, las ventajas de SDRAM slo se pueden observar en computadoras diseadas para soportar SDRAM. SDRAM est disponible en DIMM de 5 y 3,3 voltios.')
