INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'F  ', N'SDRAM - 128 MB', N'Mmoire SDRAM, capacit de 128 Mo. Ce type de mmoire permet d''accder aux donnes  des vitesses allant jusqu'' 100 MHz (jusqu'' quatre fois plus rapide qu''une mmoire DRAM standard). Ces performances ne peuvent toutefois tre ralises totalement que sur des ordinateurs conus pour prendre en charge les mmoires SDRAM. Ce type de mmoire est disponible sur des barrettes DIMM de 5 et de 3.3 volts.')
