INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'N  ', N'SDRAM - 128 MB', N'SDRAM-minne, kapasitet p 128 MB. SDRAM kan f tilgang til data ved hastigheter p opptil 100 MHz, som er opptil fire ganger s raskt som standard-DRAM. Fordelene ved SDRAM kan utnyttes fullt ut, men bare av datamaskiner som er utviklet til  sttte SDRAM. SDRAM er tilgjengelig p 5- og 3-3-volts DIMM.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'NL ', N'SDRAM - 128 MB', N'SDRAM-geheugen, 128 MB. SDRAM kan gegevens met een snelheid van maximaal 100 MHz benaderen, wat vier keer sneller is dan standaard DRAM''s. De voordelen van SDRAM kunnen alleen volledig worden benut door computers die voor SDRAM zijn ontworpen. SDRAM is beschikbaar op DIMM''s van 3,3 en 5 volt.')
