INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'PT ', N'SDRAM - 128 MB', N'Memria SDRAM, 128 MB de capacidade.  possvel  memria SDRAM ter acesso aos dados a velocidades at 100 MHz, cerca de quatro vezes mais rpido do que DRAMs standard. Contudo, s  possvel beneficiar integralmente das vantagens da memria SDRAM em computadores concebidos para suportar SDRAM. A memria SDRAM est disponvel em DIMMs de 5 e 3,3 volts.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (1739, N'PTB', N'SDRAM - 128 MB', N'Memria SDRAM, capacidade de 128 MB. A SDRAM pode acessar dados, a velocidades de at 100 MHz, ou seja, quatro vezes mais rpida do que as DRAMs padro. Entretanto, as vantagens da SDRAM s podem ser totalmente percebidas pelos computadores projetados para suportarem a SDRAM. A SDRAM est disponvel em DIMMs de 5 e 3,3 volts.')
