INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'CA ', N'SDRAM - 48 MB', N'Memria SIMM: RAM - 48 MB. SDRAM pot funcionar en mode burst. En aquest mode, quan s''accedeix a una sola adrea de dades, es recupera un bloc sencer en comptes d''una sola porci. S''assumeix que la segent porci de dades que se sollicitar ser la que segueix en ordre seqencial a l''anterior. Com que normalment s aix, les dades es retenen per poder disposar d''elles.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'CS ', N'SDRAM - 48 MB', N'Pam?? SIMM: RAM - 48 MB. Pam?? SDRAM m?e pracovat ve shlukovm (nrazovm) reimu (burst mode). V tomto reimu, kdy je dosaeno jedn datov adresy, na?te se cel blok dat namsto jen jedn ?sti. P?edpokladem je, e nsledujc ?st dat, kter bude poadovna, bude nsledovat za p?edchoz. Protoe to tak obvykle je, jsou data rychle dostupn.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'D  ', N'SDRAM - 48 MB', N'Memory SIMM: RAM - 48 MB. SDRAM kann im Burst-Modus benutzt werden. Im Burst-Modus wird ein ganzer Datenblock abgerufen und nicht nur ein Teil.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'DK ', N'SDRAM - 48 MB', N'SIMM-hukommelse: RAM - 48 MB. SDRAM kan operere i burst-tilstand. I burst-tilstand hentes hele datablokken, nr en enkelt datadresse tilgribes, i stedet for kun det pgldende stykke. Formodningen er, at det nste stykke data, der anmodes om, ligger ved siden af det forrige. Eftersom det normalt er tilfldet, er data umiddelbart tilgngelige.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'E  ', N'SDRAM - 48 MB', N'Memoria SIMM: 48 MB de RAM. SDRAM puede operar en modo burst. En este modo, al acceder a una sola direccin de datos, se recupera un bloque completo de datos en lugar de slo una parte. Se supone que la siguiente parte de datos que se solicitar ser la siguiente a la anterior. Puesto que ste es el caso normalmente, los datos se mantienen siempre disponibles.')
