INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'F  ', N'SDRAM - 48 MB', N'Mmoire SIMM : RAM 48 Mo. La mmoire SDRAM peut fonctionner en mode continu. Dans ce mode, lors de l''accs  une adresse unique, un bloc de donnes entier est extrait plutt qu''uniquement l''lment. Cela suppose que le prochain lment de donnes requis suivra le prcdent. Ce cas de figure tant le plus frquent, les donnes sont maintenues disponibles.')
