INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'HU ', N'SDRAM - 48 MB', N'Memria-SIMM: RAM - 48 MB. Az SDRAM burst-mdban is m?kdik. Ebben a mdban, egy adat megcmzsekor a teljes adatblokk beolvasdik az egyetlen adat helyett, mivel felttelezhet?, hogy a kvetkez? olvass az el?z? el?tt vagy utn fog trtnni. Mivl ltalban gy trtnik, az adat mr kszen ll a feldolgozsra.')
