INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'N  ', N'SDRAM - 48 MB', N'Minne-SIMM: RAM - 48 MB. SDRAM kan fungere i avbruddsmodus (burst). Nr det er tilgang til en enkelt adresse i avbruddsmodus, hentes en hel datablokk i stedet for bare den ene delen. Antakelsen er at den neste datadelen det vil bli anmodet om, vil vre sekvensiell med den forrige. Siden dette vanligvis er tilfelle, blir dataene holdt klare.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'NL ', N'SDRAM - 48 MB', N'Geheugen-SIMM: RAM - 48 MB. SDRAM kan werken in burst-modus. Wanneer in deze modus een enkel gegevensadres wordt benaderd, wordt er in plaats van n stuk gegevens een geheel blok met gegevens opgehaald. De reden daarvoor is, dat de volgende gegevens ook moeten worden opgehaald. Aangezien dit doorgaans het geval is, worden de gegevens alvast opgehaald.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'PL ', N'SDRAM - 48 MB', N'Pami?? SIMM: RAM - 48 MB. Pami?? SDRAM mo?e pracowa? w trybie seryjnym. W tym trybie dane s? przesy?ane blokami, a nie pojedynczo, poniewa? statystycznie dane s? najcz??ciej pobierane z kolejnych komrek pami?ci.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'PT ', N'SDRAM - 48 MB', N'SIMM de Memria: RAM - 48 MB.  possvel  memria SDRAM funcionar em modo burst. No modo burst, quando tem acesso a um nico endereo de dados,  obtido o bloco de dados integral e no apenas o componente especfico. Parte-se do princpio de que o componente de dados que ser pedido em seguida ser sequencial em relao ao anterior. Visto que esta  a situao mais frequente, os dados esto imediatamente disponveis.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'PTB', N'SDRAM - 48 MB', N'SIMM de Memria: RAM - 48 MB. A SDRAM pode operar no modo burst. No modo burst, quando um nico endereo de dados  acessado, um bloco inteiro de dados  recuperado, em vez de apenas uma parte. A expectativa  de que a prxima parte de dados a ser solicitada ser seqencial em relao  primeira. Como geralmente  isso o que ocorre, os dados ficam prontamente disponveis.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'RO ', N'SDRAM - 48 MB', N'SIMM de memorie: RAM - 48 MO. SDRAM poate opera n mod de transfer n rafale. n acest mod, cnd este accesat? o singur? adres? de date, este preluat un ntreg bloc de date. Se presupune c? datele solicitate ulterior vor face parte din secven?a urm?toare. Deoarece de obicei se ntmpl? acest lucru, datele sunt re?inute pentru a fi disponibile.')
