INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2276, N'S  ', N'SDRAM - 48 MB', N'SIMM-minne: RAM - 48 MB. SDRAM kan fungera i verfringslgen fr flera samtidiga paket ("burst mode"). I detta lge hmtas ett helt datablock nr en dataadress ns, i stllet fr bara en del. Det antas d att nsta datadel som kommer att efterfrgas ligger efter den fregende delen. Eftersom detta oftast r fallet, hlls data omedelbart tillgngliga.')
