INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'CA ', N'DIMM - 512 MB', N'Memria DIMM de 512 MB. Granularitat d''ampliaci de memria millorada: Calen menys DIMM que SIMM per actualitzar un sistema. Ampliaci dels lmits de memria mxima: amb el mateix nmero de ranures de memria, la quantitat mxima de memria del sistema s superior quan s''utilitzen DIMM que quan s''utilitzen SIMM. Les DIMM tenen contactes separats a cada banda de la placa que dupliquen la relaci de dades d''una SIMM.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'CS ', N'DIMM - 512 MB', N'Pam?? 512 MB DIMM. Zdokonalen granularita roz?en pam?ti. K roz?en systmu je poadovno mn? pam?t DIMM ne by bylo nutn k roz?en stejnho systmu pomoc SIMM pam?t. Zv?ten hranice maximln pam?ti: P?i danm stejnm po?tu pam??ovch slot? je hranice maximln pam?ti systmu p?i pouit DIMM pam?t v?t ne p?i pouit pam?t SIMM. Pam?ti DIMM maj samostatn kontakty na kad stran? desky, kter poskytuj dvojnsobn rychlosti p?enosu dat ne pam?ti SIMM.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'D  ', N'DIMM - 512 MB', N'512 MB DIMM Memory. Verbessertes Memory-Upgrade: Weniger DIMMs sind fr einen System-Upgrade erforderlich als bei SIMMs.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'DK ', N'DIMM - 512 MB', N'512 MB DIMM-hukommelse. Forbedret hukommelsesopdatering: Der krves frre DIMM-moduler til at opgradere et system, end hvis der blev brugt SIMM-moduler i det samme system. Forget maksimum hukommelse: Med et givent antal hukommelsessokler er den maksimale hukommelse for et system, der bruger DIMM-moduler, strre end for et sytem, der bruger SIMM-moduler. DIMM-moduler har separate kontakter p hver side af kortet, hvilket giver dobbelt hastighed i forhold til SIMM-moduler.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'E  ', N'DIMM - 512 MB', N'Memoria DIMM de 512 MB. Granularidad de actualizacin de memoria mejorada: Para actualizar un sistema se necesitan menos DIMM de los que seran necesarios si se utilizaran SIMM en el mismo sistema. Lmites mximos de memoria aumentados: Con un mismo nmero de ranuras de memoria, la memoria mxima de un sistema que utiliza DIMM es mayor que la de uno que utilice SIMM. Las DIMM tienen diferentes contactos en cada lateral de la tarjeta, lo que proporciona un ratio de datos del doble que una SIMM.')
