INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'F  ', N'DIMM - 512 MB', N'Mmoire DIMM 512 Mo. Degr de finesse de mise  niveau de mmoire amlior : la mise  niveau d''un mme systme exige moins de barrettes DIMM que de barrettes SIMM. Quantit de mmoire maximale accrue : pour un mme nombre d''emplacements mmoire, la quantit de mmoire maximale d''un systme utilisant des barrettes DIMM est suprieure  un systme utilisant des barrettes SIMM. Une barrette DIMM comporte sur chacun de ses cts des contacts spars, ce qui permet d''atteindre des dbits de donnes deux fois plus levs qu''une barrette SIMM.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'FRC', N'DIMM - 512 MB', N'Mmoire DIMM 512 Mo. Degr de finesse de mise  niveau de mmoire amlior : la mise  niveau d''un mme systme exige moins de barrettes DIMM que de barrettes SIMM. Quantit de mmoire maximale accrue : pour un mme nombre d''emplacements mmoire, la quantit de mmoire maximale d''un systme utilisant des barrettes DIMM est suprieure  un systme utilisant des barrettes SIMM. Une barrette DIMM comporte sur chacun de ses cts des contacts spars, ce qui permet d''atteindre des dbits de donnes deux fois plus levs qu''une barrette SIMM.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'HU ', N'DIMM - 512 MB', N'512 MB DIMM-memria. Megnvelt memriafrisstsi granularits: kevesebb DIMM-re van szksg a rendszer frisstshez, mintha SIMM-ek lennnek a rendszerben. Megnvelt maximlis memriamret: azonos szm memriaaljzatnl DIMM-ek hasznlatval a maximlis memria tbb, mint SIMM-ek hasznlatval. A DIMM-eken a lap mindkt oldaln tallhatk csatlakozk, ami ktszeres adatsebessget jelent a SIMM-ekhez kpest.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'I  ', N'DIMM - 512 MB', N'Memoria DIMM da 512 MB. Granularit aggiornamento memoria potenziata: con il medesimo sistema i DIMM richiedono l''aggiornamento al pari dei SIMM. Tetto massimo memoria potenziata: a parit di slot di memoria la memoria massima di un sistema che utilizza DIMM  maggiore della memoria di un sistema che utilizza SIMM. I DIMM dispongono di contatti separati su ciascun lato della scheda; la scheda fornisce una velocit dati doppia rispetto alla SIM.')
