INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'N  ', N'DIMM - 512 MB', N'512 MB DIMM-minne. Forbedret minneoppgraderingsgranularitet: Frre DIMM-brikker kreves for  oppgradere et system enn det som er tilfelle hvis det brukes SIMM-brikker i samme system. kte maksimale minnetak: Med samme antall minnespor er det maksimale minnet for et system som bruker DIMM-brikker, mer enn ett som bruker SIMM-brikker. DIMM-brikker har separate kontakter p hver side av kortet, noe som gir dobbelt s stor datahastighet som n SIMM-brikke.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'NL ', N'DIMM - 512 MB', N'512 MB DIMM-geheugen. Verbeterde upgrade van het geheugen: er zijn minder DIMM''s nodig om een systeem te upgraden dan wanneer SIMM''s in het systeem zouden worden gebruikt. Hogere maximumplaflonds van het geheugen: uitgaande van hetzelfde aantal geheugenslots is het maximale geheugen van een systeem met DIMM''s groter dan van een systeem met SIMM''s. Bij DIMM''s zitten aparte contactpunten aan weerszijden van de kaart waardoor de gegevensoverdracht tweemaal groter is dan van n SIMM.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'PL ', N'DIMM - 512 MB', N'Pami?? 512 MB DIMM. ?atwiejsza rozbudowa pami?ci: Do uaktualnienia systemu potrzeba mniej uk?adw DIMM ni? SIMM. Ponadto uk?ady DIMM maj? dwa rz?dy stykw, dzi?ki czemu s? dwukrotnie wydajniejsze od uk?adw SIMM.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'PT ', N'DIMM - 512 MB', N'DIMM de 512 MB de memria. Granularidade de actualizao da memria melhorada: So necessrios menos DIMMs para actualizar o sistema do que atravs da utilizao de SIMMs no mesmo sistema. Limites mximos de memria aumentados: Com o mesmo nmero de ranhuras para memria, a memria dos sistemas que utilizam DIMMs  superior  dos sistemas que utilizam SIMMs. Os DIMMs tm contactos separados em cada lado da placa, os quais fornecem o dobro da taxa de dados de um SIMM.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'PTB', N'DIMM - 512 MB', N'Memria DIMM de 512 MB. Granularidade de upgrade de memria aperfeioada: menos DIMMs so necessrios para o upgrade de um sistema do que seriam se os SIMMs fossem utilizados no mesmo sistema. Limites mximos de memria aumentada: dado o mesmo nmero de slots de memria, o mximo de memria de um sistema que utiliza DIMMs  maior do que o de outro que usa SIMMs. DIMMs tm contatos separados em cada lado da placa, o que proporciona uma taxa de dados duas vezes maior do que os de um SIMM.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'RO ', N'DIMM - 512 MB', N'Memorie DIMM de 512 MO. Granularitate mbun?t??it? pentru upgrade de memorie: Sunt necesare mai pu?ine DIMM-uri dect SIMM-uri pentru a face upgrade unui sistem. Limit? m?rit? pentru memoria maxim?: Pentru acela?i num?r de sloturi, memoria maxim? a sistemului care utilizeaz? DIMM-uri este mai mare dect atunci cnd se utilizeaz? SIMM-uri. DIMM-urile au contacte separate pe fiecare parte a pl?cii, ceea ce confer? dublarea capacit??ii oferite de SIMM-uri.')
