INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'S  ', N'DIMM - 512 MB', N'DIMM-minne p 512 MB. Frbttrad kornighet fr minnesuppgraderingen: Frre DIMM-minnen behvs fr att uppgradera ett system n vad som krvs om SIMM-minnen anvnds i samma system. Utkade maximala minnestak: Med samma antal kortplatser blir minnesmngden strre vid anvndning av DIMM n vid anvndning av SIMM. DIMM-minnen har separata kontakter i bda ndar, vilket ger dubbla datahastigheten jmfrt med ett SIMM-minne.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2400, N'SF ', N'DIMM - 512 Mt', N'512 megatavun DIMM-muisti. Muistipivitys vhemmill komponenteilla: DIMM-muistikampoja tarvitaan vhemmn jrjestelmn muistinlisykseen kuin jos kytettisiin SIMM-muistia. Muistinlaajennuksen enimmismr on kasvanut: Samoilla muistipaikoilla voidaan DIMM-muistia kyttmll saada suurempi muistinlaajennus kuin SIMM-muisteilla. DIMM-kampojen molemmilla puolilla on omat kontaktinsa, jolloin niihin voidaan tallentaa kaksi kertaa enemmn tietoa kuin SIMM-kampoihin.')
