INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'CA ', N'Memria EDO de 8 MB', N'Memria SIM EDO 8 x 32 de 8 MB. La memria EDO (sortida de dades ampliada) es diferencia de la FPM en un canvi de disseny petit per significatiu. A diferncia de l''FPM, els controladors de sortida de dades per a EDO segueixen actius quan el controlador de memria elimina l''adrea de columna per comenar el segent cicle. Per tant, comena un cicle de dades nou abans no hagi finalitzat el cicle anterior. L''EDO est disponible en SIMM i DIMM, en varietats de 3,3 i 5 volts.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'CS ', N'8 MB pam?? EDO', N'Pam?? 8 MB 8 x 32 EDO SIM. Pam?? typu EDO (Extended Data Out) se li od pam?ti typu FPM v malch, ale podstatnch konstruk?nch zm?nch. Na rozdl od typu FPM, ovlada?e na vstup dat pro EDO z?stvaj zapnuty, kdy ?adi? pam?ti odstra?uje adresu sloupce p?ed zapo?etm nsledujcho cyklu. Proto m?e za?t nov datov cyklus p?edtm, ne je dokon?en p?edchoz datov cyklus. EDO se dodv na modulech SIMM a DIMM, v proveden 3,3 V a 5 V.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'D  ', N'8MB EDO Memory', N'8 MB 8x32 EDO SIM-Speicher. Erweiterter Datenspeicher mit neuem Design. EDO ist bei SIMMS und DIMMS in 3,3 und 5 Volt Versionen erhltlich.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'DK ', N'8MB EDO-hukommelse', N'8 MB 8x32 EDO SIM-hukommelse. Forskellen mellem Extended Data Out-hukommelse (EDO) og FPM er en lille, men vigtig designndring. I modstning til FPM forbliver dataoutput-driverne til EDO tndt, nr hukommelsescontrolleren fjerner kolonneadressen for at begynde den nste cyklus. Derfor kan en ny datacyklus begynde, fr den forrige cyklus er afsluttet. EDO fs p SIMM- og DIMM-moduler, i 3,3 og 5 volt.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'E  ', N'8 MB de Memoria EDO', N'Memoria SIM de EDO de 8 MB 8 x 32. La memoria EDO (salida de datos extendida) se diferencia de FPM en un pequeo pero significativo cambio de diseo. A diferencia de FPM, los controladores de salida de datos para EDO permanecen activos cuando el controlador de memoria elimina la direccin de la columna para comenzar el siguiente ciclo. Por lo tanto, puede empezar un nuevo ciclo de datos antes de que haya terminado el anterior. EDO est disponible en SIMM y DIMM, en 3,3 y 5 voltios.')
