INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'ESA', N'8 MB de Memoria EDO', N'Memoria SIM de EDO de 8 MB 8 x 32. La memoria EDO (salida de datos extendida) se diferencia de FPM en un pequeo pero significativo cambio de diseo. A diferencia de FPM, los controladores de salida de datos para EDO permanecen activos cuando el controlador de memoria elimina la direccin de la columna para comenzar el siguiente ciclo. Por lo tanto, puede empezar un nuevo ciclo de datos antes de que haya terminado el anterior. EDO est disponible en SIMM y DIMM, en 3,3 y 5 voltios.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'F  ', N'8MB EDO Memory', N'Mmoire EDO SIM 8x32 8 Mo. La mmoire EDO (Extended Data Out) diffre de faon significative de la mmoire FPM au niveau de sa conception. Contrairement  la mmoire FPM, les pilotes de sortie de donnes de la mmoire EDO restent actifs lorsque le contrleur de mmoire supprime l''adresse de colonne pour commencer le cycle suivant. Par consquent, un nouveau cycle de donnes peut commencer avant la fin du cycle prcdent. La mmoire EDO est disponible sur des barrettes SIMM et DIMM, 3.3 et 5 volts.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'FRC', N'8MB EDO Memory', N'Mmoire EDO SIM 8x32 8 Mo. La mmoire EDO (Extended Data Out) diffre de faon significative de la mmoire FPM au niveau de sa conception. Contrairement  la mmoire FPM, les pilotes de sortie de donnes de la mmoire EDO restent actifs lorsque le contrleur de mmoire supprime l''adresse de colonne pour commencer le cycle suivant. Par consquent, un nouveau cycle de donnes peut commencer avant la fin du cycle prcdent. La mmoire EDO est disponible sur des barrettes SIMM et DIMM, 3.3 et 5 volts.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'HU ', N'8 MB EDO-memria', N'8 MB 8 x 32 EDO SIM-memria. Az EDO-memrik egy kis, de jelent?s mrtkben klnbznek az FPM-t?l. Az EDO adatkiviteli illeszt?programjai bekapcsolva maradnak, amikor a memriavezrl? eltvoltja az oszlopcmet a kvetkez? ciklus megkezdshez. Az EDO rendelkezsre ll SIMM- s DIMM-memrikhoz is, 3,3 s 5 voltos vltozatban.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'I  ', N'Memoria EDO da 8 MB', N'Memoria SIM EDO 8x32 da 8 MB. La memoria differisce dall''FPM per le dimensioni ridotte. A differenza della FPM, le unit per l''emissione dati della EDO sono attive quando il controller della memoria rimuove l''indirizzo della colonna per dare inizio al nuovo ciclo. In questo modo pu iniziare un nuovo ciclo di dati prima del completamento del ciclo precedente. La EDO  disponibile su SIMM e DIMM, a 3,3 e 5 volt.')
