INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'N  ', N'8 MB EDO-minne', N'8 MB 8x32 EDO SIMM-minne. EDO-minne (Extended Data Out) er skiller seg fra FPM ved en liten, men betydningsfull designendring. I motsetning til FPM forblir utdatadriverne for EDO p nr minnekontrolleren fjerner kolonneadressen for  begynne neste syklus. Derfor kan en ny datasyklus begynne fr den forrige syklusen er fullfrt. EDO er tilgjengelig p SIMM- og DIMM-brikker, i 3,3-og 5-volts variasjoner.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'NL ', N'8 MB EDO-geheugen', N'8 MB 8x32 EDO SIM-geheugen. Het ontwerp van het Extended Data Out-geheugen verschilt op een klein maar belangrijk detail van FPM. In tegenstelling tot FPM blijven de gegevensuitvoerstuurprogramma''s voor EDO ingeschakeld staan wanneer de geheugencontroller het kolomadres naar de volgende cyclus verplaatst. Daarom kan een nieuwe gegevenscyclus starten voordat de vorige cyclus is geindigd. EDO is beschikbaar op SIMM''s en DIMM''s van 3,3 en 5 volt.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'PL ', N'Pami?? EDO 8 MB', N'8 MB 8 x 32 uk?adw pami?ci EDO SIM. Pami?? z rozszerzonym wyj?ciem danych r?ni si? ma?ym, ale znacz?cym szczeg?em od uk?adw FPM. Dane pozostaj? na wyj?ciu uk?adu EDO nawet po wy??czeniu przez sterownik pami?ci sygna?u adresowego, co oznacza pocz?tek kolejnej operacji na pami?ci. Dzi?ki temu nowa operacja mo?e si? rozpocz?? jeszcze przed zako?czeniem poprzedniej. Pami?ci EDO s? dost?pne jako SIMM-y i DIMM-y, w odmianach 3,3- oraz 5-woltowych.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'PT ', N'8MB Memria EDO', N'8 MB de memria 8x32 EDO SIM. A memria Extended Data Out difere da memria FPM numa pequena mas significativa alterao de concepo. Ao contrrio da memria FPM, os drivers de sada de dados da memria EDO permanecem activos quando o controlador da memria retira o endereo da coluna para iniciar o ciclo seguinte. Assim,  possvel ao ciclo de dados novo comear antes da concluso do ciclo anterior. A memria EDO est disponvel em SIMMs e DIMMs, nas variedades de 3,3 e 5 volts.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'PTB', N'Memria EDO de 8MB', N'Memria SIM EDO de 8x32 8 MB. A memria EDO (Extended Data Out)  difere um pouco da FPM, mas apresenta uma significante mudana em seu design. Ao contrrio da FPM, os drivers de sada de dados para a EDO permanecem ativos quando o controlador de memria remove o endereo da coluna para comear o prximo ciclo. Portanto, um novo ciclo de dados pode comear antes do trmino do ciclo anterior. A EDO est disponvel em SIMMs e DIMMs, nas variedades de 3,3 e 5 volts.')
