INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'S  ', N'EDO-minne p 8 MB', N'EDO SIM-minne p 8 MB 8x32. EDO-minnen (Extended Data Out) skiljer sig frn FPM med en liten men betydelsefull konstruktionsndring. Till skillnad frn FPM kvarstr utdatadrivrutinerna fr EDO nr minneskontrollen tar bort kolumnadressen fr att brja nsta cykel. Drfr kan en ny datacykel pbrjas innan den fregende har slutfrts. EDO finns fr SIMM- och DIMM-minnen, med 3,3 och 5 volt.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'SF ', N'8 Mt EDO-muisti', N'8 megatavun 8x32 EDO SIMM-muisti. Extended Data Out -tyypin muisti eroaa FPM (Fast Page Mode) -muistista vhn, mutta silti merkittvsti. FPM-muistista poiketen EDO-muistin lhtevn datan ohjaimet pysyvt pll, kun muistinohjaus poistaa sarakeosoitteen ennen uuden kierroksen aloittamista. Siksi uusi datakierros voi alkaa ennen kuin edellinen on pttynyt. EDO-muistia saadaan sek 3,3- ett 5-voltin SIMM- ja DIMM-kampoina.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (2412, N'SK ', N'8 MB EDO pam?', N'8 MB 8 x 32 EDO SIM pam?. EDO (Extended Data Out) pam? sa li od FPM malou, ale vznamnou zmenou kontrukcie. Na rozdiel od FPM ovlda?e dtovho vstupu pre EDO ostvaj zapnut, ke? pam?ov radi? odstrni adresu st?pca, aby za?al nasledujci cyklus. Preto nov dtov cyklus me za?a? skr, ako sa skon? predchdzajci. EDO je k dispozcii na SIMM a DIMM v 3,3 a 5 voltovch verzich.')
