INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3065, N'D  ', N'Monitor 21/D', N'CRT Monitor 21 Inch (20 sichtbar). Digital OptiScan-Technologie: untersttzt Auflsungen bis zu 1600 x 1200 bei 75Hz. Abmessungen (HxBxT): 8,3 x 18,5 x 15 Zoll. Die abnehmbaren, am Bildschirm angeschlossenen Platinum Series-Lautsprecher gewhrleisten klare Tne und die Vorteile eines digitalen Audio Player Jacks. Stecken Sie einfach den digitalen Audio Player ein und hren Sie, ohne den PC einschalten zu mssen.')
