INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'CA ', N'VRAM - 64 MB', N'Mdul de memria RAM de vdeo Citrus - 64 MB de capacitat. Fsicament, la VRAM s igual que la DRAM amb un hardware afegit anomenat registre de canvi. La caracterstica especial de la VRAM s que pot transferir una fila sencera de dades (fins a 256 bits) a aquest registre de canvi en un sol cicle de rellotge. Aquesta capacitat redueix significativament el temps de recuperaci, ja que el nombre de cerques es reduex de les 256 cerques possibles a una de sola. L''avantatge principal de tenir el registre de canvi disponible per als buidatges de dades s que s''allibera la CPU per refrescar la pantalla en comptes de recuperar les dades, amb la qual cosa es duplica l''ample de banda de dades. Per aquest motiu, habitualment es fa referncia a la VRAM com a memria de doble porta. No obstant aix, el registre de canvi noms s''utilitza quan el xip de VRAM envia instruccions especials per fer-ho. La comanda per utilitzar el registre de canvi la genera el controlador de grfics.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'CS ', N'VRAM - 64 MB', N'Pam??ov modul Citrus Video RAM - kapacita 64 MB. Fyzicky vypad VRAM pln? stejn? jako DRAM s p?idanm hardwarem nazvanm posouvac registr. Speciln vlastnost pam?ti VRAM je, e m?e p?enst jednu celou ?adu dat (a 256 bit?) do tohoto posouvacho registru v jednom cyklu hodin. Tato schopnost vznamn? sniuje vybavovac dobu, protoe po?et p?stup? je snen z monch 256 na jeden p?stup. Hlavn vhodou dostupnosti posouvacho registru pro uloen dat je, e uvoln CPU pro obnovovn obrazovky namsto na?tn dat a tm se zdvojnsob ?ka psma dat. Z tohoto d?vodu se ?asto mluv o pam?ti VRAM jako o dvouportov (dvoubrnov). Avak posouvac registr bude pouit jen tehdy, kdy ?ip pam?ti VRAM dostane speciln instrukci na provd?n tto funkce. P?kaz na pouit posouvacho registru je vestav?n v grafickch ?adi?ch.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'D  ', N'VRAM - 64 MB', N'Citrus Video RAM-Speichermodul - 64 MB Kapazitt. Physikalisch sieht VRAM genau wie DRAM aus, mit einer zustzlichen Hardware, die als Shift Register bezeichnet wird. Ist in einen Graphics Controller integriert.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'DK ', N'VRAM - 64 MB', N'Citrus Video RAM-hukommelsesmodul - 64 MB kapacitet. Fysisk ligner VRAM DRAM med tilfjelsen af en hardwaredel, der kaldes et skifteregister. Det specielle ved VRAM er, at det kan overfre en hel rkke af data (op til 256 bit) til dette skifteregister i en enkelt urcyklus. Dette reducerer i hj grad hentningstiden, eftersom antallet af hentninger reduceres fra mulige 256 hentninger til en enkelt hentning. Hovedfordelen ved at have et tilgngeligt skifteregister til dataafleveringer er, at det frigiver CPU''en, s den kan opdatere skrmen i stedet for at hente data, hvilket fordobler databndbredden. Af den grund refereres der ofte til VRAM som dual-ported. Det pgldende skifteregister bruges imidlertid kun, nr VRAM-chippen fr specielle instruktioner om at bruge den. Kommandoen, der angiver, at skifteregisteret skal bruges, er indbygget i grafikcontrolleren.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'E  ', N'VRAM - 64 MB', N'Mdulo de memoria RAM de Vdeo Citrus: 64 MB de capacidad. Fsicamente, VRAM se parece a DRAM con un hardware agregado denominado registro de cambio. La funcin especial de VRAM es que puede transferir una fila completa de datos (hasta 256 bits) a este registro de cambio en un slo ciclo de reloj. Esta funcin reduce significativamente el tiempo de recuperacin, ya que el nmero de recuperaciones se reduce desde una 256 a una sola recuperacin. La ventaja principal de tener un registro de cambio disponible para los volcados de datos es que permite a la CPU refrescar la pantalla en lugar de recuperar los datos, con lo que se duplica el ancho de banda de los datos. Por este motivo, se considera a menudo que VRAM tiene dos puertos. Sin embargo, el registro de cambio slo se utilizar se le indique expresamente al chip de VRAM. El comando para utilizar el registro de cambio se crea en el controlador de grficos.')
