INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'ESA', N'VRAM - 64 MB', N'Mdulo de memoria RAM de Vdeo Citrus: 64 MB de capacidad. Fsicamente, VRAM se parece a DRAM con un hardware agregado denominado registro de cambio. La funcin especial de VRAM es que puede transferir una fila completa de datos (hasta 256 bits) a este registro de cambio en un slo ciclo de reloj. Esta funcin reduce significativamente el tiempo de recuperacin, ya que el nmero de recuperaciones se reduce desde una 256 a una sola recuperacin. La ventaja principal de tener un registro de cambio disponible para los volcados de datos es que permite a la CPU refrescar la pantalla en lugar de recuperar los datos, con lo que se duplica el ancho de banda de los datos. Por este motivo, se considera a menudo que VRAM tiene dos puertos. Sin embargo, el registro de cambio slo se utilizar se le indique expresamente al chip de VRAM. El comando para utilizar el registro de cambio se crea en el controlador de grficos.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'F  ', N'VRAM - 64 MB', N'Module de mmoire RAM vido (VRAM) Citrus, capacit de 64 Mo. Physiquement, la mmoire VRAM est identique  la mmoire DRAM, avec en plus un lment matriel appel registre  dcalage. La caractristique importante de la mmoire VRAM consiste en la possibilit de transfrer une ligne de donnes entire (jusqu'' 256 octets) dans le registre  dcalage, en un seul rythme, ce qui permet de rduire de faon significative les temps d''extraction, tant donn que le nombre d''extractions (ventuellement 256) est rduit  un seul. Le principale avantage qu''offre un registre  dcalage disponible pour le vidage des donnes est qu''il libre l''unit centrale CPU afin de rgnrer l''cran, plutt que d''extraire les donnes, doublant de ce fait la largeur de bande des donnes. Pour cette raison, la mmoire VRAM est souvent dite  double accs. Le registre  dcalage ne sera toutefois utilis que lorsque la puce VRAM aura reu des instructions en ce sens. La commande permettant d''utiliser le registre  dcalage est intgre au contrleur graphique.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'FRC', N'VRAM - 64 MB', N'Module de mmoire RAM vido (VRAM) Citrus, capacit de 64 Mo. Physiquement, la mmoire VRAM est identique  la mmoire DRAM, avec en plus un lment matriel appel registre  dcalage. La caractristique importante de la mmoire VRAM consiste en la possibilit de transfrer une ligne de donnes entire (jusqu'' 256 octets) dans le registre  dcalage, en un seul rythme, ce qui permet de rduire de faon significative les temps d''extraction, tant donn que le nombre d''extractions (ventuellement 256) est rduit  un seul. Le principale avantage qu''offre un registre  dcalage disponible pour le vidage des donnes est qu''il libre l''unit centrale CPU afin de rgnrer l''cran, plutt que d''extraire les donnes, doublant de ce fait la largeur de bande des donnes. Pour cette raison, la mmoire VRAM est souvent dite  double accs. Le registre  dcalage ne sera toutefois utilis que lorsque la puce VRAM aura reu des instructions en ce sens. La commande permettant d''utiliser le registre  dcalage est intgre au contrleur graphique.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'HU ', N'VRAM - 64 MB', N'Citrus VRAM-memriamodul - 64 MB-os kapacits. Fizikailag a VRAM gy nz ki, mint a DRAM, csak van benne egy eltolsi regiszter. Ez a specilis kpessge teszi lehet?v a VRAM-ot arra, hogy egy rajel alatt, egy teljes adatsort (maximum 256 bitet) thelyezzen ebbe a specilis regiszterbe. Ez a kpessg jelent?sen lecskkenti a beolvassi id?t, mivel a lehetsges 256 beolvass lecskken mindssze egyre. A legnagyobb el?nye annak, hogy az adattvitelhez egy eltolsi regiszter ll rendelkezsre az, hogy az adatbeolvass helyett a processzor a kperny?t tudja frissteni, amivel megktszerez?dik a svszlessg. Emiatt a VRAM-ot gyakran hvjk dualportosnak is, de az eltolsi regisztert csak akkor hasznlja, ha erre a VRAM specilis utastst kap. Az eltolsi regiszter alkalmazshoz hasznlt parancs a videovezrl?be van beptve.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'I  ', N'VRAM - 64 MB', N'Modulo memoria Video RAM Citrus - Capacit: 64 MB. Ha lo stesso aspetto della memoria DRAM ma dispone anche di un registro a scorrimento. La caratteristica peculiare della memoria VRAM  la possibilit di trasferire un''intera riga di dati (fino a 256 bit) nel registro a scorrimento in un unico ciclo. In questo modo si riducono i ritardi poich il numero di recuperi si riduce da 256 ad uno solo. Il vantaggio principale del registro a scorrimento  costituito dal fatto che la CPU viene liberata per aggiornare lo schermo piuttosto che per recuperare dati e quindi dal conseguente raddoppiamento della larghezza di banda dei dati. Per questo motivo la memoria VRAM viene spesso detta memoria ad accesso doppio. Il registro a scorrimento viene tuttavia utilizzato soltanto quando ai chip della VRAM vengono date istruzioni specifiche a riguardo. Il comando che consente di utilizzare il registro a scorrimento  contenuto nel controller grafico.')
