INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'N  ', N'VRAM - 64 MB', N'Citrus VRAM-minnemodul (Video RAM) - Kapasitet p 64 MB. Fysisk ser VRAM nyaktig ut som DRAM med ekstra maskinvare kalt et skiftregister. Spesialfunksjonen for VRAM er at det kan overfre en hel datarad (opptil 256 biter) til et skiftregister i en enkelt klokkesyklus. Denne muligheten reduserer hentetiden betydelig, siden antall hentinger reduseres fra opptil 256 til n enkelt henting. Den viktigste fordelen ved  ha et skiftregister tilgjengelig for datadumper, er at det frigir CPUen til  friske opp skjermen i stedet for  hente data, og derved dobles bndbredden. Av denne grunnen refereres det ofte til VRAM som dobbeltport. Skiftregisteret vil imidlertid bare bli brukt nr det er gitt spesielle instruksjoner til  gjre det. Kommandoen for  bruke skriftregisteret er bygd inn i grafikkontrolleren.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'NL ', N'VRAM - 64 MB', N'Citrus Video RAM-geheugenmodule - 64 MB. Qua uiterlijk ziet VRAM er hetzelfde uit als DRAM, met als extra hardware een shiftregister. Het speciale kenmerk van VRAM is, dat het n hele rij gegevens (maximaal 256 bits) in een enkele klokcyclus naar dit shiftregister kan overbrengen. Hierdoor worden gegevens aanzienlijk sneller opgehaald, aangezien het aantal ophaalbewerkingen van 256 is teruggebracht tot een enkele ophaalbewerking. Het grote voordeel van een shiftregister voor gegevensdumps is, dat de CPU wordt vrijgegeven om het scherm vr het ophalen van de gegevens te vernieuwen, waardoor de bandbreedte wordt verdubbeld. VRAM wordt vaak ''dual-ported'' genoemd. Het shiftregister wordt echter alleen gebruikt wanneer de VRAM-chip hiervoor speciale instructies ontvangt. De opdracht voor het gebruiken van het shiftregister is ingebouwd in de grafische controller.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'PL ', N'VRAM - 64 MB', N'Modu? pami?ci wideo Citrus RAM - 64 MB. Fizycznie uk?ad VRAM jest podobny do uk?adu DRAM, do ktrego dodano sprz?towy rejestr przesuni?cia. Dzi?ki temu pami?? VRAM mo?e w jednym cyklu zegara przes?a? ca?y wiersz danych (maksymalnie 256 bitw) do rejestru przesuni?cia. Gwarantuje to szybsze przesy?anie danych. G?wn? korzy?ci? jest odci??enie mikroprocesora z konieczno?ci od?wie?ania zawarto?ci ekranu. Z tego powodu pami?? VRAM jest cz?sto nazywana dwuportow?. Rejestr przesuni?cia jest obs?ugiwany przez specjalne instrukcje wbudowane w sterownik karty graficznej.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'PT ', N'VRAM - 64 MB', N'Mdulo de Memria RAM de Vdeo Citrus - 64 MB de capacidade. Fisicamente, a memria VRAM tem um aspecto semelhante  DRAM com hardware acrescentado designado por shift register. A funcionalidade especial da memria VRAM  a capacidade de transferncia de uma linha integral de dados (at 256 bits) para este shift register num nico ciclo do relgio. Esta capacidade reduz significativamente o tempo de obteno, visto que o nmero de extraces  reduzido de possveis 256 para uma nica extraco. O principal benefcio de ter um shift register disponvel para despejos de dados  a libertao da CPU para renovar o ecr em vez de obter dados, o que permite a duplicao da largura de banda de dados. Por este motivo,  frequente a referncia  memria VRAM como memria de porta dupla. No entanto, o shift register s ser utilizado quando forem fornecidas instrues especiais para esse efeito ao chip de VRAM. O comando para utilizao do shift register est integrado no controlador grfico.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'PTB', N'VRAM - 64 MB', N'Mdulo de memria de Vdeo RAM Citrus - capacidade de 64 MB. Fisicamente, o VRAM  igual  DRAM com a adio do hardware chamado registrador de deslocamento. A caracterstica especial do VRAM  que ele pode transferir uma linha de dados completa (de at 256 bits) nesse registrador de deslocamento, em um nico ciclo de clock. Essa capacidade reduz significativamente o tempo de recuperao, uma vez que o nmero de buscas  reduzido de possveis 256 para uma nica busca. A vantagem principal de ter um registrador de deslocamento disponvel para a colocao de dados  que ele libera a CPU para renovar a tela, em vez de recuperar os dados, duplicando a largura da banda dos dados. Por isso, a VRAM  freqentemente mencionada como sendo de porta dupla. Entretanto, o registrador de deslocamento s ser utilizado quando o chip da VRAM receber instrues especiais de execuo. O comando para utilizar o registrador de deslocamento est integrado ao controlador grfico.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'RO ', N'VRAM - 64 MB', N'Modul de memorie video RAM Citrus - capacitate de 64 MO. Fizic, VRAM arat? exact ca ?i DRAM cu un adaos hardware numit registru de deplasare. Facilitatea deosebit? a VRAM este c? poate transfera un rnd ntreg de date (pn? la 256 bi?i) n acest registru de deplasatre ntr-un singur ciclu de ceas. Aceast? abilitate reduce semnificativ timpul de reg?sire a informa?iilor, deoarece num?rul de prelu?ri se reduce de la un posibil 256 la 1. Principalul beneficiu de a avea un registru de deplasare disponibil pentru desc?rc?ri de date este c? elibereaz? CPU pentru remprosp?tarea ecranului mai curnd dect s? preia datele, astfel dublnd l?rgimea benzii de date. Pentru acest motiv, deseori se face referire la VRAM ca fiind dublu port. Totu?i, registrul de deplasare va fi utilizat numai cnd cipul VRAM va primi instruc?iuni speciale n acest sens. Comanda de utilizare a registrului de deplasare este ncorporat? n controlerul grafic.')
