INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'S  ', N'VRAM - 64 MB', N'Citrus Video RAM-minnesmodul p 64 MB. Fysiskt ser VRAM ut exakt som DRAM med extra maskinvara som kallas ett skiftregister. VRAM:s speciella funktion r att det kan verfra en hel datarad (upp till 256 bitar) till detta skiftregister i en enda klockcykel. P s stt minskas verfringstiden betydligt, eftersom antalet hmtningar minskas frn mjliga 256 till en enda. Den viktiga frdelen med att ha ett skiftregister tillgngligt fr datadumpar r att processorn frigrs fr att uppdatera skrmen i stllet fr att hmta data, vilket frdubblad bandbredden fr data. Av den orsaken kallas VRAM ofta tvportad. Skiftregistret kan dock bara anvndas nr VRAM-chipet fr srskilda anvisningar att gra s. Kommandot att anvnda registret r inbyggt i grafikkortets styrenhet.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'SF ', N'VRAM - 64 Mt', N'64 megatavun Citrus Video-RAM. VRAM on kuten DRAM-muisti, mutta videomuistipiiriin on listty ominaisuus nimelt siirtorekisteri. VRAM-muistin erityisominaisuutena on, ett se voi siirt koko datarivin (aina 256 bitti) siirtorekisteriin yhden kellosyklin aikana. Tiedonhakuajat vhenevt huomattavasti, koska mahdollisten hakukertojen lukumr vhenee 256 kerrasta vain yhteen. Siirtorekisterin pasiallisin etu on, ett tietojen siirto rekisteriin vapauttaa suorittimen virkistmn nytn sen sijaan, ett sit tarvittaisiin tiedonhakuun. Nin datakaistan leveys voidaan kaksinkertaistaa. Tst syyst VRAM-muistista puhuttaessa puhutaan kaksiporttisesta muistista. Siirtorekisteri voidaan kuitenkin kytt vain, jos VRAM-piirille annetaan asianmukainen komento. Siirtorekisterin kyttkomento on ohjelmoitu suoraan grafiikkaohjaimeen.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'SK ', N'VRAM - 64 MB', N'Pam?ov modul Citrus Video RAM - kapacita 64 MB. Fyzicky vyzer VRAM rovnako ako DRAM s pridanm hardvrom, ktor sa nazva posunovac register. Osobitnou vlastnos?ou VRAM je, e doke prenies? cel riadok dt (a do 256 bitov) do tohto posunovacieho registra v jedinom cykle hodn. Tto schopnos? vrazne zniuje ?as na?tania, ke?e po?et vyvolan sa zniuje z monch 256 na jedin vyvolanie. Hlavnm prnosom posunovacieho registra na vpisy dt je, e uvo??uje CPU na obnovovanie obrazovky namiesto na?tavania dt, ?m zdvojnsobuje dtov rku psma. Z tohto dvodu sa VRAM ?asto ozna?uje ako dvojportov. Posunovac register sa vak pouije len vtedy, ke? ?ip VRAM dostane pecilne intrukcie, aby to urobil. Prkaz na pouitie posunovacieho registra je zabudovan do grafickho radi?a.')
