INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'TR ', N'VRAM - 64 MB', N'Citrus Video RAM bellek modl - 64 MB kapasite. Fiziksel olarak, VRAM aynen kayd?rma yazmac? adl? eklenmi? donan?ma sahip DRAM''ye benzer. VRAM''nin zelli?i, bu kayd?rma yazmac?na tek bir saat devrinde tm bir veri sat?r?n?n (en ok 256 bit) transferini yapabilmesidir. Alma say?s? olas? de?er olan 256''dan tek bir almaya indirgendi?i iin bu yetenek, alma sresini nemli lde azalt?r. Veri bellek dkm iin mevcut kayd?rma yazmac?na sahip olman?n ana kazanc?, bunun ekran? yenilemek iin veri almak yerine CPU''yu bo?altmas? ve bylelikle veri bant geni?li?ini iki kat?na ?karmas?d?r. Bu nedenle, VRAM''ye ift ba?lant? noktal? oldu?u iin ba?vurulur. Ancak, kayd?rma yazmac? sadece VRAM ipine bunu kullanmas? iin zel talimat verildi?inde kullan?l?r. Kayd?rma yazmac?n? kullanacak komut grafik kontrolclerinde yerle?iktir.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3091, N'US ', N'VRAM - 64 MB', N'Citrus Video RAM memory module - 64 MB capacity. Physically, VRAM looks just like DRAM with added hardware called a shift register. The special feature of VRAM is that it can transfer one entire row of data (up to 256 bits) into this shift register in a single clock cycle. This ability significantly reduces retrieval time, since the number of fetches is reduced from a possible 256 to a single fetch. The main benefit of having a shift register available for data dumps is that it frees the CPU to refresh the screen rather than retrieve data, thereby doubling the data bandwidth. For this reason, VRAM is often referred to as being dual-ported. However, the shift register will only be used when the VRAM chip is given special instructions to do so. The command to use the shift register is built into the graphics controller.')
