INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'CA ', N'SDRAM - 16 MB', N'Mdul d''actualitzaci de memria SDRAM, 16 MB. La memria d''accs aleatoria dinmica sncrona va sser introduda desprs de l''EDO. La seva arquitectura i el seu funcionament es basen en la DRAM estndard, per l''SDRAM introdueix un canvi revolucionari a la memria principal per reduir encara ms els temps de recuperaci de dades. L''SDRAM est sincronitzada amb el rellotge del sistema que controla la CPU. Aix significa que el rellotge del sistema que controla les funcions del microprocessador controla tamb les funcions de la SDRAM. D''aquesta manera, el controlador de la memria pot saber en quin cicle del rellotge estar llesta la sollicitud de dades i s''eliminen els retards.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'CS ', N'SDRAM - 16 MB', N'Pam??ov modul SDRAM na roz?en pam?ti, 16 MB. Pam?? SDRAM (synchronn dynamick pam?? s p?mm p?stupem) byla zavedena po pam?tech EDO. Jej architektura a funkce jsou zaloeny na standardu DRAM, ale SDRAM poskytuje revolu?n zm?nu v hlavn pam?ti, co dle sniuje dobu vybavovn dat. SDRAM je synchronizovna se systmovmi hodinami, kter ?d CPU. To znamen, e systmov hodiny, ?dc funkce mikroprocesoru ?d tak funkce pam?ti SDRAM. To umon ?adi?i pam?ti v?d?t, na kterm cyklu hodin bude p?ipraven poadavek na data a proto eliminuje ?asov zpod?n.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'D  ', N'SDRAM - 16 MB', N'SDRAM Memory-Upgrade-Modul, 16 MB. Synchronous Dynamic Random Access Memory wurde nach EDO eingefhrt. Ermglicht einen schnellen Datenabruf.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'DK ', N'SDRAM - 16 MB', N'Opgraderingsmodul til SDRAM-hukommelse, 16 MB. Synchronous Dynamic Random Access Memory (SDRAM) blev introduceret efter EDO. Dets arkitektur og funktionsmde er baseret p standard-DRAM, men SDRAM er en banebrydende ndring i hovedhukommelse, der yderligere reducerer datahentningstider. SDRAM er synkroniseret med det systemur, der kontrollerer CPU''en. Dette betyder, at det systemur, der kontrollerer funktionerne for microprocessoren, ogs kontrollerer funktionerne for SDRAM''en. Det giver hukommelsescontrolleren mulighed for at vide, i hvilken urcyklus en dataanmodning er parat, og derved fjerne tidsforsinkelser.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'E  ', N'SDRAM - 16 MB', N'Mdulo de actualizacin de memoria SDRAM, 16 MB. La memoria de acceso aleatoria dinmica sncrona (SDRAM) se ha introducido despus de EDO. Su arquitectura y operacin se basan en las de DRAM estndar, pero SDRAM proporciona un cambio revolucionario en la memoria principal que reduce an ms los tiempos de recuperacin de datos. SDRAM est sincronizada con el reloj del sistema que controla la CPU. Esto significa que el reloj del sistema que controla las funciones del microprocesador tambin controla las funciones de SDRAM. Esto permite al controlador de la memoria saber en qu ciclo del reloj estar preparada la solicitud de datos y, por lo tanto, elimina los retrasos de temporizacin.')
