INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'ESA', N'SDRAM - 16 MB', N'Mdulo de actualizacin de memoria SDRAM, 16 MB. La memoria de acceso aleatoria dinmica sncrona (SDRAM) se ha introducido despus de EDO. Su arquitectura y operacin se basan en las de DRAM estndar, pero SDRAM proporciona un cambio revolucionario en la memoria principal que reduce an ms los tiempos de recuperacin de datos. SDRAM est sincronizada con el reloj del sistema que controla la CPU. Esto significa que el reloj del sistema que controla las funciones del microprocesador tambin controla las funciones de SDRAM. Esto permite al controlador de la memoria saber en qu ciclo del reloj estar preparada la solicitud de datos y, por lo tanto, elimina los retrasos de temporizacin.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'F  ', N'SDRAM - 16 MB', N'Module de mise  niveau de mmoire SDRAM 16 Mo. La mmoire SDRAM (Synchronous Dynamic Random Access Memory) est apparue aprs la mmoire EDO. Bien que son architecture et son fonctionnement soient fonds sur ceux de la mmoire DRAM standard, la mmoire SDRAM apporte un changement rvolutionnaire  la mmoire centrale permettant de rduire davantage les temps d''extraction de donnes. La mmoire SDRAM est synchronise avec l''horloge systme qui contrle l''unit centrale. En d''autres termes, l''horloge systme qui contrle les fonctions du microprocesseur, contrle galement les fonctions de la mmoire SDRAM. Ceci permet au contrleur de mmoire de connatre  quel rythme la demande de donnes sera prte, et d''liminer par consquent les dlais de synchronisation.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'FRC', N'SDRAM - 16 MB', N'Module de mise  niveau de mmoire SDRAM 16 Mo. La mmoire SDRAM (Synchronous Dynamic Random Access Memory) est apparue aprs la mmoire EDO. Bien que son architecture et son fonctionnement soient fonds sur ceux de la mmoire DRAM standard, la mmoire SDRAM apporte un changement rvolutionnaire  la mmoire centrale permettant de rduire davantage les temps d''extraction de donnes. La mmoire SDRAM est synchronise avec l''horloge systme qui contrle l''unit centrale. En d''autres termes, l''horloge systme qui contrle les fonctions du microprocesseur, contrle galement les fonctions de la mmoire SDRAM. Ceci permet au contrleur de mmoire de connatre  quel rythme la demande de donnes sera prte, et d''liminer par consquent les dlais de synchronisation.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'HU ', N'SDRAM - 16 MB', N'SDRAM-memriafrisstsi modul, 16 MB. A Synchronous Dynamic Random Access Memory az EDO utn kerlt bevezetsre. A felptse s m?kdse a DRAM-on alapul, de az SDRAM egy forradalmi jtst vezetett be a f?memrinl, amely tovbb cskkenti az adatbeolvassi id?t. Az SDRAM a processzort vezrl? rendszerrhoz van szinkronizlva. Ez azt jelenti, hogy a processzor funkciit vezrl? ra vezrli az SDRAM funkciit is. Ezltal a memriavezrl? tudja, melyik rajelnl vlik elrhet?v az adatkrelem, gy cskken a vrakozsi id?.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'I  ', N'SDRAM - 16 MB', N'Modulo aggiornamento memoria SDRAM, 16 MB. La SDRAM (Synchronous Dynamic Random Access Memory)  stata introdotta dopo la EDO. L''architettura e il funzionamento si basano sugli standard della memoria DRAM, ma la modifica rivoluzionaria in memoria principale produce un''ulteriore riduzione dei tempi di recupero dati. La SDRAM  sincronizzata con l''orologio di sistema che controlla la CPU. L''orologio di sistema che controlla le funzioni del microprocessore controlla pertanto anche le funzioni della SDRAM, in tal modo al controller della memoria  noto il ciclo che contiene la richiesta dei dati e i ritardi vengono eliminati.')
