INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'N  ', N'SDRAM - 16 MB', N'SDRAM-minneoppgraderingsmodul, 16 MB. SDRAM-minne (Synchronous Dynamic Random Access) ble introdusert etter EDO. Arkitekturen og driftsmten er basert p de for standard DRAM, men SDRAM gir en revolusjonerende endring i hovedminnet som reduserer datahentetidene ytterligere. SDRAM er synkronisert til systemklokken som styrer CPUen. Det betyr at systemklokken som styrer funksjonene for mikroprosessoren, ogs styrer SDRAM-funksjonene. Det gjr det mulig for minnekontrolleren  vite p hvilken klokkesyklus en dataanmodning vil bli klar, og tidsstyringsforsinkelser fjernes derved.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'NL ', N'SDRAM - 16 MB', N'Upgrademodule voor SDRAM-geheugen, 16 MB. Synchronous Dynamic Random Access Memory is na EDO gentroduceerd. De architectuur en de werking van dit geheugen is gebaseerd op die van de standaard DRAM, maar SDRAM heeft een revolutionaire wijziging teweeggebracht in het hoofdgeheugen waardoor gegevens nog sneller worden opgehaald. SDRAM loopt synchroon met de systeemklok die de CPU regelt. Dit betekent dat de systeemklok die de functies van de microprocessor regelt, ook de SDRAM-functies regelt. Zo weet de geheugencontroller welke klokcyclus die om gegevens heeft gevraagd, klaar is waardoor er minder vertraging optreedt.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'PL ', N'SDRAM - 16 MB', N'Modu? uaktualnienia pami?ci SDRAM, 16 MB. Synchroniczna dynamiczna pami?? RAM zast?pi?a pami?? EDO. Struktura logiczna pami?ci SDRAM jest zgodna ze struktur? pami?ci DRAM z jedn? r?nic?: pami?? SDRAM jest zsynchronizowana z zegarem systemowym, steruj?cym prac? mikroprocesora. Pozwala to na wyeliminowanie zb?dnych op?nie? na linii mikroprocesor-pami??.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'PT ', N'SDRAM - 16 MB', N'Mdulo de actualizao de memria SDRAM, 16 MB. A Memria de Acesso Aleatrio Dinmico e Sncrono (SDRAM) foi apresentada aps a memria EDO. A arquitectura e o funcionamento baseiam-se em DRAM standard, mas a memria SDRAM fornece uma alterao revolucionria  memria principal que reduz ainda mais os intervalos de obteno dos dados. A memria SDRAM est sincronizada com o relgio do sistema que controla a CPU. Deste modo, o relgio do sistema que controla as funes do microprocessador tambm controla as funes da memria SDRAM. Assim,  possvel ao controlador de memria determinar o ciclo do relgio no qual o pedido de dados estar pronto e, desta forma, eliminar os atrasos de temporizao.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'PTB', N'SDRAM - 16 MB', N'Mdulo de upgrade de memria SDRAM, 16 MB. A Memria de Acesso Aleatrio Dinmico Sncrono foi introduzida aps a EDO. Sua arquitetura e funcionamento baseiam-se nos da DRAM padro, mas a SDRAM proporciona uma alterao revolucionria  memria principal que reduz ainda mais os tempos de recuperao de dados. A SDRAM  sincronizada com o clock do sistema que controla a CPU. Isso significa que o clock do sistema, ao controlar as funes do microprocessador, tambm controla as funes da SDRAM. Com isso, o controlador de memria ser capaz de saber em qual ciclo do clock um pedido de dados ficar pronto e, portanto, eliminar atrasos.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'RO ', N'SDRAM - 16 MB', N'Modul de upgrade al memoriei SDRAM, 16 MO. SDRAM (memorie cu acces aleator dinamic sincronizat) s-a introdus dup? EDO. Arhitectura sa ?i modul de operare sunt bazate pe standardul DRAM, dar SDRAM asigur? o modificare revolu?ionar? a memoriei principale care reduce mai mult timpii de preluare a datelor. SDRAM este sincronizat? cu ceasul de sistem care controleaz? CPU. Aceasta nseamn? c? ceasul de sistem care controleaz? func?iile microprocesorului controleaz?, de asemenea, func?iile SDRAM. Acest lucru permite controlerului de memorie s? ?tie pe care ciclu de ceas va fi preg?tit? o solicitare de date, eliminnd astfel ntrzierile.')
