INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'S  ', N'SDRAM - 16 MB', N'Uppgraderingsmodul fr SDRAM-minne p 16 MB. SDRAM (Synchronous Dynamic Random Access Memory) introducerades efter EDO. Dess struktur och anvndning bygger p standard-DRAM-tekniken, men SDRAM har kommit med omvlvande frndringar vad gller huvudminnet som ytterligare reducerar dataverfringstiderna. SDRAM synkroniseras med systemklockan som kontrollerar processorn. Det innebr att systemklockan styr mikroprocessorfunktionerna som i sin tur styr SDRAM-funktionerna. P s stt kan minneskontrollen knna av under vilken klockcykel ett datajobb kommer att vara klart, vilket eliminerar tidsfrdrjningar.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'SF ', N'SDRAM - 16 Mt', N'SDRAM-muistipivitysmoduuli, 16 Mt. SDRAM eli Synchronous Dynamic Random Access Memory tuli markkinoille EDO-muistin jlkeen. SDRAM-muistin arkkitehtuuri ja toiminta perustuu perinteiselle DRAM-tekniikalle, mutta poikkeaa merkittvsti pmuistin ksittelyss, mik vhent tiedonhakuaikoja entisestn. SDRAM on synkronoitu tietokoneen pprosessoria ohjaavan kellon kanssa. Tm tarkoittaa, ett mikroprosessoria ohjaava jrjestelmn kello ohjaa mys SDRAM:in toimintaa. Nin muistinohjain tiet, mill kellosyklill tietopyynt on valmiina, jolloin ajoitusviivet poistuvat.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'SK ', N'SDRAM - 16 MB', N'Rozirovac modul pamte SDRAM, 16 MB. SDRAM (Synchronous Dynamic Random Access Memory) bola uveden po EDO. Jej architektra a fungovanie s zaloen na tandardnej DRAM, ale SDRAM poskytuje revolu?n zmenu v hlavnej pamti, ktor ?alej zniuje ?asy vyvolania dt. SDRAM je synchronizovan na systmov hodiny, ktor riadia CPU. To znamen, e systmov hodiny riadiace funkcie mikroprocesora riadia aj funkcie SDRAM. To umo?uje pam?ovmu radi?u zisti? cyklus hodn, v ktorom bude dtov poiadavka vykonan, a tm eliminova? oneskorenia ?asovania.')
