INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'TR ', N'SDRAM - 16 MB', N'SDRAM bellek ykseltme modl, 16 MB. Senkronize Dinamik Rasgele Eri?imli Bellek, EDO''dan sonra piyasaya srlm?tr. Bunun mimarisi ve i?letimi standart DRAM''lerdeki gibidir, ancak SDRAM, veri alma sresini daha da azaltan bellek saklama a?s?ndan devrim say?labilecek bir de?i?iklik sa?lar. SDRAM, CPU''yu kontrol eden sistem saatiyle senkronize edilir. Bu da, mikro i?lemcinin fonksiyonlar?n? kontrol eden sistem saatinin, SDRAM fonksiyonlar?n? da kontrol etti?i anlam?na gelir. Bu, bellek kontrolcsnn, veri talebinin hangi saat devrinde haz?r olaca??n? bilmesini olanak verir ve bylece zamanlama gecikmelerini ortadan kald?r?r.')
INSERT [oe].[PRODUCT_DESCRIPTIONS] ([PRODUCT_ID], [LANGUAGE_ID], [TRANSLATED_NAME], [TRANSLATED_DESCRIPTION]) VALUES (3359, N'US ', N'SDRAM - 16 MB', N'SDRAM memory upgrade module, 16 MB. Synchronous Dynamic Random Access Memory was introduced after EDO. Its architecture and operation are based on those of the standard DRAM, but SDRAM provides a revolutionary change to main memory that further reduces data retrieval times. SDRAM is synchronized to the system clock that controls the CPU. This means that the system clock controlling the functions of the microprocessor also controls the SDRAM functions. This enables the memory controller to know on which clock cycle a data request will be ready, and therefore eliminates timing delays.')
