INSERT [oe].[PRODUCT_INFORMATION] ([PRODUCT_ID], [PRODUCT_NAME], [PRODUCT_DESCRIPTION], [CATEGORY_ID], [WEIGHT_CLASS], [WARRANTY_PERIOD], [SUPPLIER_ID], [PRODUCT_STATUS], [LIST_PRICE], [MIN_PRICE], [CATALOG_URL]) VALUES (3091, N'VRAM - 64 MB', N'Citrus Video RAM memory module - 64 MB capacity. Physically, VRAM looks just like DRAM with added hardware called a shift register. The special feature of VRAM is that it can transfer one entire row of data (up to 256 bits) into this shift register in a single clock cycle. This ability significantly reduces retrieval time, since the number of fetches is reduced from a possible 256 to a single fetch. The main benefit of having a shift register available for data dumps is that it frees the CPU to refresh the screen rather than retrieve data, thereby doubling the data bandwidth. For this reason, VRAM is often referred to as being dual-ported. However, the shift register will only be used when the VRAM chip is given special instructions to do so. The command to use the shift register is built into the graphics controller.', 14, 1, N'+00-06', 102098, N'orderable', CAST(279.00 AS Decimal(8, 2)), CAST(243.00 AS Decimal(8, 2)), N'http://www.supp-102098.com/cat/hw/p3091.html')
